import { DireflowComponent } from 'direflow-component';
import App from './App';

const direflowProps = {
  text: 'testiteksti',
}

export default DireflowComponent.create({
  component: App,
  configuration: {
    tagname: 'content-scroller',
    properties: direflowProps,
  },
  plugins: [
    {
      name: 'font-loader',
      options: {
        google: {
          families: ['Advent Pro', 'Noto Sans JP'],
        },
      },
    },
  ],
});
